import React, {ReactElement} from "react";
import {NavLink} from "react-router-dom";

interface ILinkProps {
    linkHref: string
    children: React.ReactNode
}

export const MenuLink: React.FC<ILinkProps> = (props) => {
    return (
        <NavLink to={props.linkHref}>
            {props.children}
        </NavLink>
    )
};
